import React from 'react'
import Game from '../Game'

const games = [
    {
      name: "Prince of Persia",
      mode: "Solo",
      genre: "Adventure",
    },
    {
      name: "Call of Duty",
      mode: "Solo",
      genre: "FPS",
    },
    {
      name: "Super Smash Bros Melee",
      mode: "Multi",
      genre: "Platform",
    },
    {
      name: "It Takes Two",
      mode: "Coop",
      genre: "Adventure",
    },
  ];

const GamesList = ({name, genre, game}) => {
    return (
        <div id="list">
            {games.map((game) => (<Game name={game.name} genre={game.genre} mode={game.mode} />))}
        </div>
    )

}

export default GamesList
